def getPDFdata(pdfName):
	os.chdir(DIR_SOURCES)
	with open(pdfName, 'rb') as fh: pdfData = fh.read()

	base64Data = base64.b64encode(pdfData).decode('utf-8')

	if(pdfName == 'hl.pdf'):
		os.remove(pdfName)
	return base64Data


